/* eslint-disable jsx-a11y/heading-has-content */
import Provinsi from "../Provinsi/Provinsi";
import StyledProvinces from "./Province.styled";

const Provinces = () => {

    return(
        <StyledProvinces>
        <div>
            <section>
                <h2>Provinsi</h2>
                <h4>Data Covid Berdasarkan Provinsi</h4>
            <div>
            <Provinsi/>
            </div>
            </section>
        </div>
        </StyledProvinces>

    )
}

export default Provinces;
